<head>

    <style>

        /*北投區*/
        #taipei-district-1:hover {
            fill: #01759A;

        /*內湖區*/
        #taipei-district-3:hover {
            fill: #63A49C;
            cursor: pointer;
        }

        /*中山區*/
        #taipei-district-4:hover {
            fill: #C12520;
            cursor: pointer;
        }

        /*大同區*/
        #taipei-district-5:hover {
            fill: #E87100;
            cursor: pointer;
        }

        /*中正區*/
        #taipei-district-6:hover {
            fill: #6069E3;
            cursor: pointer;
        }

        /*萬華區*/
        #taipei-district-7:hover {
            fill: #BEDF9C;
            cursor: pointer;
        }

            cursor: pointer;
        }

            cursor: pointer;

        body,
        html {
            margin: 0;
            padding: 0;
            height: 100%;
        }

        .video-bg {
            position: relative;
            width: 100%;
            height: 100%;
            z-index: -1;
            object-fit: cover;
            display: flex;
        }

        .svg-wrapper {
            position: relative;
            width: 100%;
            height: 100%;
            display: flex;
            justify-content: center;
            align-items: center;
            z-index: 1;
            height: 100vh
        }
    </style>
</head>

<body>
    <div id="header-container"></div>
    <script>
        fetch('header.html')
          .then(res => res.text())
          .then(data => {
            const container = document.getElementById('header-container');
            container.innerHTML = data;
    
            const scripts = container.querySelectorAll('script');
            scripts.forEach(oldScript => {
              const newScript = document.createElement('script');
              if (oldScript.src) {
                newScript.src = oldScript.src;
              } else {
                newScript.textContent = oldScript.textContent;
              }
              document.body.appendChild(newScript);
            });
          });
      </script>
      <script>
        if (window.innerWidth <= 768) {
          const introVideo = document.getElementById('intro-video');
          if (introVideo) {
            introVideo.style.display = 'none';
          }
        }
      </script>

    <div style="height: 60px;"></div>

    <section id="intro-video" style="height: 100vh; display: flex; align-items: center; justify-content: center;">
        <video autoplay loop muted playsinline style="width: 100%; height: 100%; object-fit: cover;">
            <source src="open.mp4" type="video/mp4">
        </video>
    </section>

    <div>
        <p style="height: 100px;"></p>
    </div>

    <section
        style="position: relative; height: 100vh; overflow: hidden;">
        <video autoplay muted loop playsinline style="position: absolute; top: 0; left: 0; width: 100%; height: 100%; object-fit: cover; z-index: -1;">
            <source src="background.mp4" type="video/mp4">
        </video>
